    <h2> Calculator</h2>
    <div>
        <form>
        <label for='first'> Enter first value</label>
        <input type='number' name="first" />
        
        <label for='second'> Enter second value</label>
        <input type='number' name="second"/>
        <button onClick={func}> add</button>
        <h1>ans is {ans}</h1>
        </form>
    </div>    
</div>
);
}
export default App;
